import React, { useState, useEffect } from "react";
import { motion, AnimatePresence } from "framer-motion";
import { Squash as Hamburger } from "hamburger-react";
import styles from "./Header.css";

const Header = () => {
  const [isScrolled, setIsScrolled] = useState(false);
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  const navItems = [
    { name: "Проекты", href: "#projects" },
    { name: "Технологии", href: "#tech" },
    { name: "О компании", href: "#about" },
    { name: "Контакты", href: "#contact" },
  ];

  return (
    <>
      <header
        className={`${styles.header} ${isScrolled ? styles.scrolled : ""}`}
      >
        <div className={styles.container}>
          {/* Логотип с анимацией */}
          <motion.a
            href="/"
            className={styles.logo}
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.5 }}
          >
            <span className={styles.logoMain}>ТеплоДом</span>
            <span className={styles.logoSub}>Тюмень</span>
          </motion.a>

          {/* Десктопное меню */}
          <nav className={styles.desktopNav}>
            <ul className={styles.navList}>
              {navItems.map((item, index) => (
                <motion.li
                  key={item.name}
                  initial={{ opacity: 0, y: -10 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ delay: 0.1 * index }}
                >
                  <a
                    href={item.href}
                    className={styles.navLink}
                    onMouseEnter={(e) => {
                      e.target.style.color = "#f8c537";
                      e.target.style.textShadow =
                        "0 0 8px rgba(248, 197, 55, 0.6)";
                    }}
                    onMouseLeave={(e) => {
                      e.target.style.color = "";
                      e.target.style.textShadow = "";
                    }}
                  >
                    {item.name}
                  </a>
                </motion.li>
              ))}
            </ul>
          </nav>

          {/* Кнопка CTA */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.5 }}
          >
            <button className={styles.ctaButton}>
              <span>Бесплатная консультация</span>
              <div className={styles.ctaHover}></div>
            </button>
          </motion.div>

          {/* Мобильное меню (бургер) */}
          <div className={styles.mobileMenuButton}>
            <Hamburger
              toggled={isMenuOpen}
              toggle={setIsMenuOpen}
              size={28}
              color={isMenuOpen ? "#f8c537" : isScrolled ? "#0E2A47" : "white"}
            />
          </div>
        </div>
      </header>

      {/* Мобильное меню (полноэкранное) */}
      <AnimatePresence>
        {isMenuOpen && (
          <motion.div
            className={styles.mobileMenu}
            initial={{ opacity: 0, y: -50 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -50 }}
            transition={{ type: "spring", damping: 25 }}
          >
            <ul className={styles.mobileNavList}>
              {navItems.map((item) => (
                <motion.li
                  key={item.name}
                  initial={{ opacity: 0, x: -20 }}
                  animate={{ opacity: 1, x: 0 }}
                  transition={{ type: "spring" }}
                  onClick={() => setIsMenuOpen(false)}
                >
                  <a href={item.href} className={styles.mobileNavLink}>
                    {item.name}
                  </a>
                </motion.li>
              ))}
            </ul>

            <div className={styles.mobileContacts}>
              <a href="tel:+78001234567" className={styles.mobilePhone}>
                8 (800) 123-45-67
              </a>
              <button className={styles.mobileCta}>Заказать звонок</button>
            </div>
          </motion.div>
        )}
      </AnimatePresence>
    </>
  );
};

export default Header;
